import Hero  from "../components/Hero";
import Navbar from "../components/Navbar";    
function Contact() {
    return (
        <>
            <Navbar/>
            <Hero
            cName='hero-mid'
            img='https://plus.unsplash.com/premium_photo-1661964334796-d70d1887813d?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1073&q=80'
            title='Contact'/>

        </>
    )
}

export default Contact;
